import React from 'react'
import Navbar from '../Header/Navbar/Navbar'
import * as S from './headerCart.style'

export default function HeaderCart() {
  return (
    <S.HeaderCart>
      <div className="container">
        <Navbar />
      </div>
    </S.HeaderCart>
  )
}
